	SNAIL = output[:, 77]
	SNAKE = output[:, 78]
	SPIDER = output[:, 79]
	SQUIRREL = output[:, 80]
	STREETCAR = output[:, 81]
	SUNFLOWER = output[:, 82]
	SWEET_PEPPER = output[:, 83]
	TABLE = output[:, 84]
	TANK = output[:, 85]
