	TELEVISION = output[:, 87]
	TIGER = output[:, 88]
	TRACTOR = output[:, 89]
	TRAIN = output[:, 90]
	TROUT = output[:, 91]
	TULIP = output[:, 92]
	TURTLE = output[:, 93]
	WARDROBE = output[:, 94]
	WHALE = output[:, 95]
	WILLOW_TREE = output[:, 96]
	WOLF = output[:, 97]
	WOMAN = output[:, 98]
	WORM = output[:, 99]

	# SUPER CLASSES
	AQUATIC_MAMMALS = output[:, 100]
	FISH = output[:, 101]
	FLOWERS = output[:, 102]
	FOOD_CONTAINERS = output[:, 103]
	FRUIT_AND_VEGETABLES = output[:, 104]
	HOUSEHOLD_ELECTRICAL_DEVICES = output[:, 105]
	HOUSEHOLD_FURNITURE = output[:, 106]
	INSECTS = output[:, 107]
	LARGE_CARNIVORES = output[:, 108]
	LARGE_MAN_MADE_OUTDOOR_THINGS = output[:, 109]
	LARGE_NATURAL_OUTDOOR_SCENES = output[:, 110]
